const Persons = (props) => {
    const liStyle = {
        color: 'grey',
        listStyleType: "",
        marginLeft: 10,
        marginright: 10,
      }
    const ulStyle = {
        textDecoration: ""
    }
    return(

 <ul style={ulStyle}>
{props.persons.map((person) => <li className={liStyle} key={person.id}>
                                <div className="">
                                    <div>{person.name}</div>
                                    <div>{person.number}</div>
                                    <button onClick={() => props.onDelete(person.id)} >Delete</button>
                                </div>

                            </li>)}
 </ul>
 )}

export default Persons
